      </p>
      <p>
        LinkedIn:{" "}
        <a
          href="https://linkedin.com/in/jaydipnemade16"
          className="text-blue-600"
        >
          linkedin.com/in/jaydipnemade16
        </a>
      </p>
      <p>
        GitHub:{" "}
        <a href="https://github.com/jaydipnemade" className="text-blue-600">
          github.com/jaydipnemade
        </a>
      </p>
    </section>
  );
};

export default Contact;
